import TestVue from "@/components/practice/0.TestVue.vue";
import ModelingComponent from "@/components/practice/1.ModelingComponent.vue";
import { createRouter, createWebHistory } from "vue-router"

// routes에서 url경로와 화면을 매핑
const routes = [
    {
        path: "/test",
        name: "TestVue",
        Component : TestVue
    },
    {
        path: "/modelingComponent",
        name: "TestVue1",
        Component : ModelingComponent
    }
]

const router = createRouter(
    {
        // vue router는 내부적으로 크게 2가지 종류가 있음.
        // 1) createwebHistory: localhost:3000/member/create 2) createwebhashHistory: /#/member/create
        history: createWebHistory(),
        routes
    }
)

// export된 router를 main.js에서 import해줘야함.
export default router;
